import React from "react";
import { useState } from "react";
import "./popup.css";

function POPUP({ elementsMap, stateValue, ...otherProps }) {
  const { popup, setPopup } = stateValue;

  const { key, values } = elementsMap;

  const handleEventClick = () => {
    setPopup(false);
  };
  return (
    <div className={popup ? "popup" : "hide"} {...otherProps}>
      <div className="title">{key}</div>
      <div className="description">
        <ol>
          {values
            ? values.map((element, index) => {
                return (
                  <li key={index} className="list">
                    {element}
                  </li>
                );
              })
            : ""}
        </ol>
      </div>
      <div className="dismiss-btn">
        <button className="dismiss-popup-btn" onClick={handleEventClick}>
          Dismiss
        </button>
      </div>
    </div>
  );
}

export default POPUP;
